import React from 'react'
import './GoalList.css'

const GoalList = () => {
    return ( 
        <ul className='goal-list'>
        <li>Finish the Course</li>
        <li>Learn all about the course</li>
        <li>Help other students in Q&amp;A</li>
        </ul>
    );
};

export default GoalList;
